import React from 'react';
import Navigation from '../components/others/Navigation';
import Footer from '../components/others/Footer';
import BDE from '../components/pages/Vieetudiante/BDE.js';

const Vieetudiante = () => {
  return (
    <div className="vieEtudiante">
    <Navigation />
    <div className="etuContent">
      <h1 id="etuTitle">B.U.T Réseaux et télécommunications à l'IUT de Roanne</h1>
      <Banniere />
      <ChoisirBUT />
      <Contacts />
      {/*<Newsletter />*/}
    </div>
    <Footer />
  </div>
  );
};

export default Vieetudiante;
